import React from "react";
import { Route, Link } from "react-router-dom";

const Post = () => {
  return <div>포스트</div>;
};

const Posts = () => {
  return (
    <div>
      <h1>포스트</h1>
      <Route path="/posts/:title" component={Post} />
    </div>
  );
};

export default Posts;
